							xmlExpList = exceptionIn.split("\\&\\&")//["countrycode","ns1:plz"]
						}
						if("true".equalsIgnoreCase(logEnabled)){
							log.info('@ XML ExpList is: '+xmlExpList)
						}
						JSONCompareResult resultcomp = null
						if("SOAP".equalsIgnoreCase(serviceType)){
							XMLUnit.setIgnoreAttributeOrder(true);
							XMLUnit.setIgnoreComments(true);
							XMLUnit.setIgnoreDiffBetweenTextAndCDATA(true);
							XMLUnit.setIgnoreWhitespace(true);
							XMLUnit.setNormalizeWhitespace(true);

							Diff xmlDiff=null;
							List allDifferences = []
							if(null==xmlExpList){
								xmlExpList=[]
							}
							DifferenceListener myDifferenceListener = new IgnoreNamedElementsDifferenceListener(xmlExpList);
							try {
							   xmlDiff = new Diff(newServiceResponse,baseServiceResponse);
							   xmlDiff.overrideDifferenceListener(myDifferenceListener);
							   DetailedDiff xmlDetailDiff = new DetailedDiff(xmlDiff);
		  					   allDifferences = xmlDetailDiff.getAllDifferences();
							} catch (Exception e) {
								log.info('@@@ Error: '+e)
							}
							if(null!=allDifferences && allDifferences.size()>0){
								results = "FAIL"
								for (def dfr:allDifferences){
									difBuffer.append(dfr.toString()+", ")
								}
								diffr = difBuffer.toString()
							} else {
								results = "PASS"
							}

						} else {
							if(null!=exceptionIn && !"".equalsIgnoreCase(exceptionIn) && !"null".equalsIgnoreCase(exceptionIn)){
								def expArr = exceptionIn.split("\\&\\&")
								if(null!=expArr && 0< expArr.length){
									for(def ex:expArr){
										if(null!=ex && !"".equalsIgnoreCase(ex) && !"".equalsIgnoreCase(ex.trim())){
											excepList.add(ex)
										}
									}
								}
							} else {
								if("true".equalsIgnoreCase(logEnabled)){
									log.info('@ Exception List: '+excepList)
								}
							}
							if(null!=newServiceResponse && null!=baseServiceResponse && !'null'.equalsIgnoreCase(newServiceResponse) && !'null'.equalsIgnoreCase(baseServiceResponse)
								&& !''.equalsIgnoreCase(newServiceResponse) && !''.equalsIgnoreCase(baseServiceResponse)){
								try {
									resultcomp = JSONCompare.compareJSON(baseServiceResponse, newServiceResponse, JSONCompareMode.STRICT, excepList);
								} catch (Exception e){
									resultcomp = new JSONCompareResult();
									resultcomp.fail("Exception - Seems the Service response is not in JSON format, Please check the base and target service responses.")
								}
								if(null!=resultcomp && !"".equalsIgnoreCase(resultcomp.toString()) && !"".equalsIgnoreCase(resultcomp.toString().trim())){
									results = "FAIL"
									diffr = resultcomp.toString()
								} else {
									results = "PASS"
								}
							} else {
								results = "FAIL"
								diffr = "Found Service Target or Base Response is null or empty during comparison."
							}
						}
						if("true".equalsIgnoreCase(logEnabled)){
							log.info('@ Restult is: '+results+'-->Difference is : '+diffr)
						} else {
							log.info('@ Results: '+results)
						}

						validationStatusMap.put(inputSetIncr, "[1]Auto_"+serviceName+"_"+scenario+seperator+results+seperator+serviceName+seperator+ExecutionTime+seperator+baseServiceResponse+seperator+newServiceResponse+seperator+serviceInput+lineSeperator+lineSeperator+"Header Input: "+lineSeperator+headerInput+lineSeperator+"Difference: "+lineSeperator+diffr)

						/** Remove the custom properties at suite level **/
						SoapUICore.removeServiceInputs(context,serviceInput,'testSuite')

						/** Remove header attributes **/
						SoapUICore.removeHeaderInputs(testRunner, headerInput, serviceName)
						if(null==diffr || diffr.length()==0){
							diffr=" "
						}
						/** Add record with the data of this input set to the map **/
						dataMap.put(inputSetIncr, scenario+seperator+desc+seperator+serviceName+seperator+serviceType+seperator+serviceInput+seperator+headerInput+seperator+applicatioName+seperator+baseServiceResponse+seperator+newServiceResponse+seperator+results+seperator+diffr+seperator+ExecutionTime)
						inputSetIncr++
					}
				}
			}
		}

		log.info(lineSeperator+"=====================")
		/** Update the data to the data base **/
		dbStatus = writeTargetResponseToDB(dataMap, currentDate, xid, runName, inputVersion, sql, logEnabled)
		log.info("@ DB Status: "+dbStatus)
	}
}

