/** Write the base response and master input data to the report table**/
private def writeBaseResponseToDB(def dataMap, def currentDate, def xid, def runName, def inputVersion, Sql sql, def logEnabled){
	def dbStatus, seperator= "\\^\\~", count=0, insertBaseDataQuery, deleteQuery
	dbStatus=true
	try{
		/** Date logic **/
		def dt = new Date()
		def currDt = dt.toTimestamp()
		deleteQuery = "DELETE FROM CONTINUOUSINTEGRATION.BASE_RUN_REPORT WHERE RUN_NAME=? AND SERVICE_NAME=? "
		count = sql.withBatch(deleteQuery){ ps ->
			Iterator iterator = dataMap.entrySet().iterator()
			def value, row, serviceName, baseResponse
			while (iterator.hasNext()) {
				Map.Entry mapEntry = (Map.Entry) iterator.next()
				value = mapEntry.getValue()
				row = mapEntry.getKey()
				if(null!=value && !"null".equalsIgnoreCase(value) && !"".equalsIgnoreCase(value.trim())){
					def inputValues = value.split(seperator)
					if(null!=inputValues && 0< inputValues.length){
						serviceName = inputValues[2]
						baseResponse = inputValues[7]
						try{
							ps.addBatch(runName, serviceName)
						} catch(SQLException e){
							log.info(e)
						}
					}
				}
			}
		}
		insertBaseDataQuery = "INSERT INTO CONTINUOUSINTEGRATION.BASE_RUN_REPORT (SCENARIO_NAME, DESCRIPTION, SERVICE_NAME, SERVICE_TYPE, SERVICE_INPUT, HEADER_INPUT, SKIP_FLAG, APPLICATION_NAME, INPUT_VERSION, BASE_RESPONSE, RUN_NAME, CREATED_BY, CREATED_DATE, UPDATED_BY, UPDATED_DATE, RESP_TIME) VALUES (?,?,?,?,?,?,?,?,?,?,?,?,?,?,?,?)"
		count = sql.withBatch(insertBaseDataQuery){ ps ->
			Iterator iterator = dataMap.entrySet().iterator()
			def value, row, skip, serviceInput, hdrInput, scenario, desc, serviceName, baseResponse, serviceType, skipVal, appName, respTime=0
			while (iterator.hasNext()) {
				Map.Entry mapEntry = (Map.Entry) iterator.next()
				value = mapEntry.getValue()
				row = mapEntry.getKey()
				if(null!=value && !"null".equalsIgnoreCase(value) && !"".equalsIgnoreCase(value.trim())){
					def inputValues = value.split(seperator)
					if(null!=inputValues && 0< inputValues.length){
						scenario = inputValues[0]
						desc = inputValues[1]
						serviceName = inputValues[2]
						serviceType = inputValues[3]
						serviceInput = inputValues[4]
						hdrInput = inputValues[5]
						skipVal = inputValues[6]
						appName = inputValues[7]
						baseResponse = inputValues[8]
						respTime = inputValues[9]
						if("true".equalsIgnoreCase(logEnabled)){
							//log.info('@ Base Response: '+baseResponse)
						}
						if(null==hdrInput || "null".equalsIgnoreCase(hdrInput) || "".equalsIgnoreCase(hdrInput.trim()) || "0.00".equalsIgnoreCase(hdrInput)){
							hdrInput = " "
						}
						if('0.0'.equalsIgnoreCase(appName)){
							appName = ''
						}
						if(baseResponse.size()>5242880){
							log.info('@@@ ERROR: Base Response length is more than the column length: '+baseResponse.size())
						}
						ps.addBatch(scenario, desc, serviceName, serviceType, serviceInput, hdrInput, skipVal, appName, inputVersion, baseResponse, runName, xid, currDt, xid, currentDate, respTime)
					}
				}
			}
		}
		log.info("@@ Number of records created/updated in Base_Run_Report are : "+count.size())
	} catch(BatchUpdateException buex){
		dbStatus=false
		if("true".equalsIgnoreCase(logEnabled)){
		    log.info("@@@ Error Block: Message: " + buex.getMessage())  
		    log.info("@@@ Error Block: SQLSTATE: " + buex.getSQLState())
		    log.info("@@@ Error Block: Error code: " + buex.getErrorCode())
		    SQLException ex = buex.getNextException()         
		    while (ex != null) {                                  
		      log.info("@@@ Error Block: SQL exception:");
		      log.info("@@@ Error Block: Message: " + ex.getMessage())
		      log.info("@@@ Error Block: SQLSTATE: " + ex.getSQLState())
		      log.info("@@@ Error Block: Error code: " + ex.getErrorCode())
		      ex = ex.getNextException()
		    }
		} else {
			log.info('@@@ Error: '+buex)
		}
	} catch(SQLException e){
		dbStatus=false
		if("true".equalsIgnoreCase(logEnabled)){
			def updateCount = e.getUpdateCounts()
			log.info(updateCount.size())
		     int cnt = 1
		     for (int i : updateCount) {
		         if  (i == Statement.EXECUTE_FAILED) {
		             log.info("@@@ Error Block: Error on request " + cnt +": Execute failed")
		         } else {
		            log.info("@@@ Error Block: Request " + cnt +": OK");
		         }
		         cnt++;
		     }
		} else {
			log.info('@@@ Error: '+e)
		}
	} catch(Exception se){
		dbStatus=false
		log.info('@@@ Error: '+se)
	} finally {
		return dbStatus
	}
}

/** Update report table with the new response and status**/
private def writeTargetResponseToDB(def dataMap, def currentDate, def xid, def runName, def inputVersion, Sql sql, def logEnabled){
	def dbStatus, seperator= "\\^\\~", count=0
	dbStatus=true
	try{
		/** Date logic **/
		def dt = new Date()
		def currDt = dt.toTimestamp()
		def runDate = new Date().format('MM/dd/yyyy');
		def getMaxSeq = " SELECT MAX(RUN_SEQ) AS SEQ FROM CONTINUOUSINTEGRATION.TARGET_RUN_REPORT WHERE RUN_DATE = '"+runDate+"' and RUN_NAME='"+runName+"'"
		def resSet = sql.firstRow(getMaxSeq)
		def maxSeq = resSet.SEQ
		if(null==maxSeq){
			maxSeq=0
		}
		maxSeq = maxSeq+1
		def updateTargetDataQuery = "INSERT INTO CONTINUOUSINTEGRATION.TARGET_RUN_REPORT (SCENARIO_NAME, DESCRIPTION, SERVICE_NAME, SERVICE_TYPE, SERVICE_INPUT, HEADER_INPUT, APPLICATION_NAME, INPUT_VERSION, BASE_RESPONSE, TARGET_RESPONSE, DIFFERENCE, STATUS, RUN_NAME, RUN_DATE, RUN_SEQ, CREATED_BY, CREATED_DATE, RESP_TIME) VALUES (?,?,?,?,?,?,?,?,?,?,?,?,?,?,?,?,?,?)"
		count = sql.withBatch(updateTargetDataQuery){ ps ->
			Iterator iterator = dataMap.entrySet().iterator()
			def value, row, serviceInput, hdrInput, scenario, desc, serviceName, serviceType, appName, baseResponse, releaseDat, newResponse, results, diff, respTime=0
			while (iterator.hasNext()) {
				Map.Entry mapEntry = (Map.Entry) iterator.next()
				value = mapEntry.getValue()
				row = mapEntry.getKey()
				if(null!=value && !"".equalsIgnoreCase(value.trim())){
					def inputValues = value.split(seperator)
					if(null!=inputValues && 0< inputValues.length){
						scenario = inputValues[0]
						desc = inputValues[1]
						serviceInput = inputValues[4]
						serviceName = inputValues[2]
						serviceType = inputValues[3]
						appName = inputValues[6]
						baseResponse = inputValues[7]
						newResponse = inputValues[8]
						results = inputValues[9]
						hdrInput = inputValues[5]
						diff = inputValues[10]
						respTime = inputValues[11]
						if(baseResponse.size()>5242880){
							log.info('@@@ ERROR: Base Response length is more than the column length: '+baseResponse.size())
						}
						if(newResponse.size()>5242880){
							log.info('@@@ ERROR: Target Response length is more than the column length: '+baseResponse.size())
						}
						if(diff.size()>5242880){
							log.info('@@@ ERROR: Difference length is more than the column length: '+baseResponse.size())
						}
						ps.addBatch(scenario, desc, serviceName, serviceType, serviceInput, hdrInput, appName, inputVersion, baseResponse, newResponse, diff, results, runName, runDate, maxSeq, xid, currDt, respTime)
					}
				}
			}
		}
		log.info("@@ Number of records created/updated in Target_Run_Report are : "+count.size())
	} catch(Exception e){
		dbStatus=false
		log.info(e)
	} catch(Exception se){
		dbStatus=false
		log.info(se)
	} finally {
		return dbStatus
	}
}

/** Set test cases status to soap testcaserunner **/
public void setTestCaseStatus(def dbStatus, def validationStatusMap, def logEnabled){
	def status ="", seperator= "\\^\\~", cnt=0, lineSeperator = System.getProperty("line.separator")
	if(!dbStatus){
		status = "@@@ DB Update/Insert failed."
	}
	Iterator iterator = validationStatusMap.entrySet().iterator();
	while (iterator.hasNext()) {
		Map.Entry mapEntry = (Map.Entry) iterator.next();
		String mapVal = mapEntry.getValue()
		if(null!=mapVal && !"".equalsIgnoreCase(mapVal.trim())){
			def mapValues = mapVal.tokenize(seperator)
			if(null!=mapValues && mapValues.size()>2){
				if(mapValues.get(1) =="FAIL"){
					status = status+ mapValues.get(0)+", "
					cnt++
				}
			}
		}
	}
	if("".equalsIgnoreCase(status)){
		log.info("@@ Success CIAutomationTestSuite.")
	} else {
		if("true".equalsIgnoreCase(logEnabled)){
			testRunner.fail("@@ Failed CIAutomationTestSuite for : "+status)
		} else {
			testRunner.fail("@@ Failed CIAutomationTestSuite with Number of Test Cases are : "+cnt)
		}
	}
	log.info(lineSeperator+"=====================")
}

