/** Script to connect ALM and update TestCases**/
private def updateTestCaseResults(def validationStatusMap, def logEnabled){
	def almStatus = false
	log.info('@ "'+Thread.currentThread().getName()+'"'+'Connecting to ALM to update the Number of Cases: '+validationStatusMap.size())
	Scriptom.inApartment {
			def groovyNull = VariantNull.VARIANTNULL
			testInstance=null
			/*  Create an entry point for QC */
			def tdc = new ActiveXObject ('TDApiOle80.TDConnection')
			/*  Connect to QC, Login with Credentials, connect to Project */
			def xid = testRunner.testCase.testSuite.project.getPropertyValue("ALM_USER_ID")
			def psw = testRunner.testCase.testSuite.project.getPropertyValue("ALM_PASSWORD")
			def domain = testRunner.testCase.testSuite.project.getPropertyValue("ALM_DOMAIN")
			def project = testRunner.testCase.testSuite.project.getPropertyValue("ALM_PROJECT")
			def testLabPath = testRunner.testCase.testSuite.project.getPropertyValue("ALM_TEST_LAB_DIR")
			def testSetName = testRunner.testCase.testSuite.project.getPropertyValue("ALM_TESTSET")
			def almUrl = testRunner.testCase.testSuite.project.getPropertyValue("ALM_URL")
			def defectEnbld = testRunner.testCase.testSuite.project.getPropertyValue("DEFECT_ENABLED")
			def almFilePath = testRunner.testCase.testSuite.project.getPropertyValue("ALM_SHEET_PATH")
			def attachResp = testRunner.testCase.testSuite.project.getPropertyValue("ATTACH_FOR_SUCCESS")
			def releaseDate = testRunner.testCase.testSuite.project.getPropertyValue("RELEASE_DATE")
			boolean atchResp=false
			if("true".equalsIgnoreCase(attachResp)){
				atchResp = true
			}
			try {
				tdc.InitConnectionEx(almUrl)
				tdc.Login(xid, psw)
				tdc.Connect(domain,project)
				/** Connect to ALM using LIB **/
				if("true".equalsIgnoreCase(logEnabled)){
					log.info('@@ ValidationStatusMap size is:'+validationStatusMap.size())
				}
				ALMConnection.updateTestCaseResults(tdc, validationStatusMap, "", testLabPath, testSetName, xid, defectEnbld, almFilePath, atchResp, releaseDate)
				almStatus = true
			} finally {
				if(null!=tdc){
					tdc.Disconnect()
					log.info('@@ "'+Thread.currentThread().getName()+'" ALM Update done and Connection closed successfully.')
				}
			}
		//log.info('@@ "'+Thread.currentThread().getName()+'" Done with ALM Update')
	}
	return almStatus
}

/** Write Target Response to XLS **/
private def writeTargetResponseToXLS(def dataMap, def seperator, def filePath){
	def dateTime = new Date()
	def currentDate = DateGroovyMethods.format(dateTime, 'MM-dd-yyyy_HH-mm')
	def sheetName = "Sheet_"+currentDate
	def headerList = []
	headerList.add("Scenario")
	headerList.add("Description")
	headerList.add("Service Input")
	headerList.add("ServiceName")
	headerList.add("ServiceType")
	headerList.add("Skip")
	headerList.add("Base Resp")
	headerList.add("New Resp")
	headerList.add("Status")	
	headerList.add("Release Date")
	headerList.add("Header Inputs")

	return ExcelOperations.writeToExcelWithMapBasedOnService(dataMap, seperator, headerList, filePath, sheetName)
}

